import logo from "./logo.svg";
import "./App.css";
import Timer from "./components/Timer";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hi: <Timer />
        </p>
      </header>
    </div>
  );
}

export default App;
